function CreatePlayer({ playername, team, onChange, onCreate }) {
  return (
    <div>
      <input
        name="playername"
        placeholder="선수명"
        onChange={onChange}
        value={name}
      />
      <input
        name="team"
        placeholder="소속 구단"
        onChange={onChange}
        value={team}
      />
      <button onClick={onCreate}>등록</button>
    </div>
  );
}

export default CreatePlayer;
